import React from "react";
import "./DashboardHome.css";
function DashboardHome() {
  return (
    <div className="DashboardHome">
      <h1 className="WelcomeMessage">Welcome back Username !</h1>
      <div className="boxes">
        <div className="box1">
          <h2>
            Total Money donated
          </h2>
          <p>All Time</p>
        </div>
        <div className="box2"></div>
        <div className="box2"></div>
      </div>
    </div>
  );
}

export default DashboardHome;
